import React from "react";

const Hotel = (props) => {
  return (
    <div className="container">
      <div className="row">
        <h3 className="mt-4 mb-4">Homes guests love</h3>
        {props.hotel.map((hotel) => {
          return (
            <div className="col-12 col-lg-3">
              <img src={hotel.image_url} alt={hotel.name} width="100%" />
              <div>
                <a href={handleDetail}>{hotel.name}</a>
                <p>
                  {hotel.city}
                  <br />
                  <b>Starting from ${hotel.price}</b>
                  <br />
                  <i class="fa fa-star"> {hotel.rate}</i> {hotel.type}
                </p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Hotel;
